import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPenToSquare } from '@fortawesome/free-solid-svg-icons';
import { faTrash } from '@fortawesome/free-solid-svg-icons';

export const Player = ({ player, deletePlayer, editPlayer, toggleComplete }) => {
  return (
    <div className="Player">
      <p className={`${player.completed ? "completed" : "incompleted"}`} onClick={() => toggleComplete(player.id)}>
        {player.name}
      </p>
      <div>
        <FontAwesomeIcon className="edit-icon" icon={faPenToSquare} onClick={() => editPlayer(player.id)} />
        <FontAwesomeIcon className="delete-icon" icon={faTrash} onClick={() => deletePlayer(player.id)} />
      </div>
    </div>
  );
};
